import { render } from "react-dom";
import { BrowserRouter } from "react-router-dom";
import Main from "./Main";
import Header from "./Header";

const rootElement = document.getElementById("root");
render(
  <BrowserRouter>
    <Routes>
       <Route path="/">
          <Header />
          <Main />
        </Route>
      {/* <Route path="/news" element={<News />} /> */}
     </Routes>
  </BrowserRouter>,
  rootElement
);
